import '../css/Elements.css'
import ElementComponent from '../components/ElementsCompo'
const elementsData = [
    {
        atomicNumber: 1,
        symbol: "H",
        name: "Hydrogen",
        atomicWeight: "1.008",
        group: 1,
        period: 1
    },
    {
        atomicNumber: 2,
        symbol: "He",
        name: "Helium",
        atomicWeight: "4.0026",
        group: 18,
        period: 1
    },
    {
        atomicNumber: 3,
        symbol: "Li",
        name: "Lithium",
        atomicWeight: "6.94",
        group: 1,
        period: 2
    },
    {
        atomicNumber: 4,
        symbol: "Be",
        name: "Beryllium",
        atomicWeight: "9.0122",
        group: 2,
        period: 2
    },
    {
        atomicNumber: 5,
        symbol: "B",
        name: "Boron",
        atomicWeight: "10.81",
        group: 13,
        period: 2
    },
    {
        atomicNumber: 6,
        symbol: "C",
        name: "Carbon",
        atomicWeight: "12.011",
        group: 14,
        period: 2
    },
    {
        atomicNumber: 7,
        symbol: "N",
        name: "Nitrogen",
        atomicWeight: "14.007",
        group: 15,
        period: 2
    },
    {
        atomicNumber: 8,
        symbol: "O",
        name: "Oxygen",
        atomicWeight: "15.999",
        group: 16,
        period: 2
    },
    {
        atomicNumber: 9,
        symbol: "F",
        name: "Fluorine",
        atomicWeight: "19.000",
        group: 17,
        period: 2
    },
    {
        atomicNumber: 10,
        symbol: "Ne",
        name: "Neon",
        atomicWeight: "20.180",
        group: 18,
        period: 2
    },
    // ... 이후 원소들
];

export const Elements = () => {
    return (
        <>
            <div className="MainWrap">
                <h1 className="Title">원소주기율표</h1>
                <div className="periodic-table">
                    {elementsData.map(element => (
                        <ElementComponent
    key={element.atomicNumber}
    element={element}
    style={{ gridRow: element.period, gridColumn: element.group }}
/>
                    ))}
                </div>
            </div>
        </>
    )
}
